import React from 'react';

class Footer extends React.Component {

    render() {
        return(
            <footer className="footer">
                <p style={{paddingTop:"50px"}}>This site is a demo version. We cannot yet connect you to a lawyer. More Features coming soon."</p>
            </footer>
        )
    }

}

export default Footer;
